      </Container>

      {/* Menu company */}
      <CardActions>
        <Button size="small" color="primary">
          PRESENTATION
        </Button>
        <Button size="small" color="primary">
          AUTRE JOBS
        </Button>
        <Button size="small" color="primary">
          ENTREPRISES
        </Button>
      </CardActions>
    </React.Fragment>
  );
};

export default Topprofile;
